text149477.addInnerText('<div id=\"text149477\" aria-hidden=\"true\" ><a id=\"text149477anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.384\" style=\"margin-left:0px;text-indent:0px;line-height:1.384;margin-top:0px;margin-bottom:0px;text-align:justify;\" >\n<span class=\"text149477Font1\" style=\"position:relative;top:-2px;\" >Proses ekskresi pada ginjal yaitu berupa urine. Proses pembentukan urine dalam ginjal terdiri dari 3 tahap, yaitu </span ><span class=\"text149477Font2\" style=\"position:relative;top:-2px;\" >filtrasi (penyaringan), reabsorpsi (penyerapan kembali), </span ><span class=\"text149477Font1\" style=\"position:relative;top:-2px;\" >dan </span ><span class=\"text149477Font2\" style=\"position:relative;top:-2px;\" >augmentasi (pengeluaran zat).</span ><span class=\"text149477Font1\" style=\"background-color:transparentposition:relative;top:-2px;\" >\n</span ></p >\n</div>\n');

text149481.addInnerText('<div id=\"text149481\" aria-hidden=\"true\" ><a id=\"text149481anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.661\" style=\"margin-left:0px;text-indent:0px;line-height:1.661;margin-top:0px;margin-bottom:0px;text-align:justify;\" >\n<span class=\"text149481Font1\" style=\"position:relative;top:-5px;\" >Proses </span ><span class=\"text149481Font2\" style=\"position:relative;top:-5px;\" >filtrasi</span ><span class=\"text149481Font1\" style=\"position:relative;top:-5px;\" > terjadi di glomerulus melalui membran filtrasi. Darah masuk ke dalam glomerulus dan mengalami filtrasi/penyaringan. Kandungan air, glukosa, urea, dan ion-ion organik, seperti natrium, kalium, kalsium, dan klor lolos dari penyaringan. Cairan ini kemudian masuk kedalam ruang kapsula Bowman. Sementara itu, sel-sel darah dan protein tinggal di dalam kapiler darah karena tidak dapat menembus pori-pori glomerulus. Cairan yang tertampung di kapsula Bowman disebut </span ><span class=\"text149481Font2\" style=\"position:relative;top:-5px;\" >urine primer</span ><span class=\"text149481Font1\" style=\"position:relative;top:-5px;\" >.</span ><span class=\"text149481Font3\" style=\"background-color:transparentposition:relative;top:-5px;\" >\n</span ></p >\n</div>\n');
